import styles from "./UsersList.module.css";
import UserItem from "./UserItem";

const UsersList=(props) =>{
    if(props.data.length>0){
      return (
          <ul className={styles.users}>
              {props.data.map(user=> (
              <UserItem
                  key={user.id}
                  name={user.name}
                  age={user.age}
              />))}
          </ul>
      );
    }
}
export default UsersList;
